function About(props){
      const { name } = props; // Destructure the prop
      return (
        <div>
            <Routes>
                <Route path = './contact'></Route>
            </Routes>
          <p>{name}</p>
          <p>this is the about page</p>
        </div>
      );
    }
export default About;
